import React from "react";
import Logo from "../Images/Logo";
import ElfProfile from "../Images/ProfileImages/ElfProfile";
import styled from "styled-components";
import "./containersStyle.css";

const Background = styled.div`
  background-color: #252525;
  width: 99vw;
  display: flex;
  text-align: center;
`;

const CenterContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  margin: 0 auto;
`;

const Welcome = styled.h1`
  color: #fff;
  font-size: 1.8rem;
`;

const AvatarContainer = styled.div`
  border-radius: 50%;
  width: 50px;
  height: 50px;
  background-color: #6b5386;
  align-self: center;
  margin-right: 1vw;
  overflow: hidden;
`;

class Header extends React.Component {
  state = { character: "Adventurer", avatar: undefined };
  render() {
    return (
      <Background>
        <Logo />
        <CenterContainer>
          <Welcome>Welcome {this.state.character}</Welcome>
        </CenterContainer>
        <AvatarContainer>
          <ElfProfile height="95%" style={{}} />
        </AvatarContainer>
      </Background>
    );
  }
}
export default Header;
